            subs: ["1. 在法律允许的范围内，公司不得针对本条款中未作出明确规定的具体服务事宜作出承诺或保证。此外，公司也不能保证公司所发行或支付的任何形式的货物或虚拟资产的价值。", "2. 针对违反本条款交易条例进行交易而发生的所有事故或是因销售商或采购商的归责事由而产生的纠纷，公司将概不负责。公司合作伙伴所造成的损失则根据合作伙伴条款规定予以处理，并提供相应的支持以更好地解决合作伙伴与会员之间的纠纷。", {
                tit: "3. 如果因公司故意或过失而造成会员损失，公司应按照本条款和相关法律规定赔偿损失。针对以下造成的损失，在经过公司数据确认的最终交易明细中会员可以消除错误，而公司只负责恢复那些符合错误消除结果的虚拟资产和KRW积分，对于其他损失公司则概不负责。但是，如果同时发生下列事由和公司归责事由，在法律规定的一定范围内不得免除公司责任。",
                subUl: ["① 会员的归责事由已影响到服务的使用；", "② 在访问和使用服务的过程中因会员归责事由而给会员造成损失；", "③ 第三方非法访问或使用公司服务器所造成的损失；", "④ 第三方向公司服务器发送消息或干扰公司服务器发送消息所造成的损失；", "⑤ 第三方发送或传播恶意程序所造成的损失；", "⑥ 因传输数据出现省略、遗漏或毁坏所造成的损失，第三方在服务使用过程中出现诽谤所造成的损失；", "⑦ 通信运营商提供的电信通信服务故障造成的损失，其中包括与公司和会员签订使用合同等法律关系的电信服商的归责事由等其他不可抗力因素对公司服务造成影响的情形；", "⑧ 因发生战争·事变·地震等其他类似自然灾害或国家紧急事件等不可抗力因素所造成的损失；", "⑨ 因虚拟资产本身的特点而不可避免地造成影响和损失，其中包括发行管理系统本身的缺陷或技术限制等原因对公司服务造成影响的情形；", "⑩ 公司为确保服务而检查公司服务器时所造成损失(与定期检查、临时检查、紧急检查等检查原因和检查类型无关)；", "⑪ 因其他公司故意或过失等除外的其他原因造成的损失。"]
            }, "4. 如果会员向公司提供的信息不属实，公司可以随时终止服务，并根据本条款规定解除部分或全部合同。针对公司因此而遭受的损失，公司有权向会员提出损失赔偿请求。", "5. 如果会员根据本条规定向公司提出损失赔偿请求，公司在征得会员同意后向会员最终持有的电子钱包中支付虚拟资产或KRW，以此方式来赔偿会员的损失。", "6. 如果因会员的非法行为而给公司造成损失，公司可根据法律规定向会员提出损失赔偿请求。因此，会员在使用服务时需严格遵守法律规定。"]
