            tips6: "- API를 통한 거래는 거래액 기준 산정에서 제외",
            list: [{
                text: "제1조 (목적)",
                type: "title"
            }, "이 약관은 후오비 코리아(이하 '회사')에서 제공하는 유료 서비스인 Premier Partner 멤버십 서비스의 이용과 관련하여 회사와 회원과의 권리, 의무 및 책임사항, 기타 필요한 사항을 규정함을 목적으로 합니다.", {
                text: "제2조 (정의)",
                type: "title"
            }, "이 약관에서 사용하는 용어의 정의는 다음 각호와 같습니다.", "1. 'Premier Partner 멤버십 서비스'(이하 \"서비스\")란 회사에서 제공하는 서비스로, 회원혜택 및 각종 서비스를 말합니다.", {
                text: '2. \'대상회원\'이란 회사에 가입하고 해당 아이디로 회사가 제공하는 서비스(<a href="https://www.huobi.co.kr/" rel="noopener noreferrer">https://www.huobi.co.kr/</a>)를 이용하는 것에 동의하여, 본 "서비스"에 가입 신청을 할 수 있는 고객을 말합니다',
                type: "tag"
            }, "3. '회원'이란 대상회원 중 이 약관에 동의하고 본 서비스에 가입한 회원을 말합니다.", "4. '이용기간'이란 서비스 이용료를 결제함으로써 본 서비스를 이용할 수 있는 기간을 말합니다.", "5. '서비스 신청일'이란 회원이 서비스를 최초 가입 및 결제한 당일을 말합니다. (예를 들어, 1월1일 가입 및 결제 시 서비스 신청일은 '1월1일')", {
                text: "제3조 (약관의 적용)",
                type: "title"
            }, "서비스를 이용할 때의 기준 약관은 이 약관이며, 이 약관에서 규정하고 있지 아니한 사항은 후오비 코리아 이용약관에서 적용한 바를 따릅니다. 이 약관과 개별 약관 간 상충되는 내용이 있는 경우 이 약관을 우선으로 적용합니다", {
                text: "제4조 (가입신청 및 가입신청의 승낙의 제한)",
                type: "title"
            }, "① 회원이 되고자 하는 자는 이 약관에 동의하는 방법으로 회원가입을 신청하고, 회사가 위 신청을 승낙하면 체결됩니다.", "② 다음과 같은 사유가 있으면, 회사는 가입신청을 승낙하지 않거나 승낙을 유보할 수 있습니다.", {
                text: ["1. 이용자 본인 명의로 이미 서비스에 가입 중인 경우", "2. 명의도용, 허위정보기재 등의 결격사유가 있는 경우", "3. 이 약관 제7조에 따라 서비스 이용 중단 조치 등을 받은 회원이 이용신청 제한 기간에 서비스 재가입 신청을 한 경우", "4. 기타 이 약관에 위배되거나 위법 또는 부당한 이용신청임이 확인된 경우"],
                type: "list"
            }, {
                text: "제5조 (청약철회 및 환불)",
                type: "title"
            }, "① 서비스 신청일 후 7일 이내 어떠한 서비스도 사용하지 않은 경우(콘텐츠 혜택을 이용하거나 가상자산 거래를 통해 수수료 할인을 받은 경우에는 서비스를 사용한 경우에 해당합니다)에 한하여 청약철회가 가능하며, 이 경우 회사는 회원에게 이용료 전액을 환불합니다.", "② 서비스 신청일로부터 7일 이후 본 서비스 해지요청시 또는 후오비 코리아 회원 탈퇴요청시, 이용기간이 종료할 때까지 서비스를 계속 이용할 수 있으며, 결제 금액은 환불되지 않습니다.", {
                text: "제6조 (회원의 금지행위 및 이용제한)",
                type: "title"
            }, "① 회원이 본 서비스를 이용할 때 아래 각 호에 해당하는 행위를 하는 경우, 회사는 해당 회원의 서비스 이용을 강제로 중단할 수 있으며, 해당 회원은 서비스 재가입 및 이용 신청이 제한됩니다.", {
                text: ["1. 회원의 권리, 의무의 전부 또는 일부를 타인에게 대여, 양도, 위임하는 행위", "2. 본 서비스의 혜택으로 회원에게만 제공되는 정보를 회사의 사전 승낙 없이 복제 또는 유통시키거나 상업적으로 이용하는 행위", "3. 다른 회원의 본 서비스 이용을 방해하는 행위", "4. 서비스의 안정적 운영을 방해하는 행위 기타 불법한 행위"],
                type: "list"
            }, {
                text: "제7조 (회사의 의무)",
                type: "title"
            }, "회사는 안정적인 서비스를 제공하기 위하여 최선을 다해 노력합니다.", {
                text: "제8조 (회원의 의무)",
                type: "title"
            }, "① 회원은 이 약관 및 회사가 서비스와 관련하여 고지하는 내용을 준수하여야 하며, 약관 및 고지 내용을 위반하거나 이행하지 아니하여 발생하는 모든 손실, 손해에 대하여 책임을 부담합니다.", "② 회원은 회사가 서비스를 안전하게 제공할 수 있도록 회사에 협조해야 하고, 회원정보가 부정확하여 발생하는 불이익에 대해서는 회사가 책임지지 않으며, 회사가 회원의 이 약관 위반행위를 발견하여 회원에게 해당 위반행위에 대하여 소명을 요청할 경우 회원은 회사의 요청에 적극 응해야 합니다.", "③ 회원은 서비스를 이용하면서 분쟁이 발생한 경우 분쟁의 해결을 위하여 성실히 임해야 하며, 분쟁해결에 대한 회원의 불성실로 인하여 회사에 손해가 발생한 경우 회원은 귀책사유가 있는 범위 내에서 이에 대한 책임을 부담해야 합니다.", {
                text: "제9조 (서비스의 변경 및 중단)",
                type: "title"
            }, "① 본 서비스의 혜택 구성은 회사의 사정에 따라 변경될 수 있습니다. 회사는 변경될 서비스의 내용이 적용되기 30일 전까지 회원에게 공지하거나 통지합니다.", "② 회사가 제1항에 따라 변경될 서비스의 내용을 공지 또는 통지하고, 회원이 변경될 서비스의 내용이 적용되기 전까지 변경될 내용에 대한 거부의사를 표시하지 아니할 경우, 회원이 변경될 내용에 동의한 것으로 간주합니다.", "③ 회사는 다음 각 호에 해당하는 경우 서비스의 전부 또는 일부를 제한하거나 중단할 수 있습니다. 이 경우에도 제한 또는 중단되기 전까지 회원에게 사전 공지하거나 통지하되, 회사가 통제할 수 없는 사유로 인한 중단으로 인하여 사전 공지 또는 통지가 불가능한 경우에는 공지 또는 통지가 가능한 시점에 즉시 공지 또는 통지합니다.", {
                text: ["1. 서비스용 설비의 보수 등 공사로 인한 부득이한 경우", "2. 정전, 제반 설비의 장애 또는 이용량의 폭주 등으로 정상적인 서비스 이용에 지장이 있는 경우", "3. 기타 천재지변, 국가비상사태 등 불가항력적 사유가 있는 경우"],
                type: "list"
            }, {
                text: "제10조 (서비스 종료)",
                type: "title"
            }, "회사가 서비스를 종료하고자 할 경우 회사는 본 서비스 화면을 통하여 종료일 30일전에 회원에게 공지합니다. 이 경우 회사는 회원이 서비스 종료일 전 마지막으로 결제한 이용기간에 대한 서비스 이용을 보장합니다. 단, 서비스 이용을 보장할 수 없는 경우 일할 계산하여 회원이 지불한 이용료에서 실제 사용한 기간을 차감한 후 이용료를 환불합니다."],
