            subs: ["1. ‘The member’ refers to clients who closed the service contract by agreeing to this Terms of Use and registering to our website, owning one’s own IDs.", "2. ‘Service’ refers to the Company’s virtual asset transaction services and all sorts of related services that members can utilize using all sorts of wire-wireless equipment such as computers and mobile devices", "3. ‘ID(account or ID)’ refers to combination of letters, special characters and numbers primarily registered in order to identify the members, and in this service it is indicated as email address or phone number. The ID is formed when the member agrees to the Terms of Use, registers one’s account and password, verifies oneself through email or phone number and when the Company confirms the registration", "4. ‘Password’ refers to combination of letters, numbers, etc. confirmed by the Company in order to identify the member and protect personal information", "5. ‘Virtual asset’ refers to encrypted digital cash that can be exchanged within the service such as Bitcoin, Ethereum, etc.", "6. ‘KRW’ refers to virtual cash which the member can use within the service for trading cryptocurrencies, and it can also be exchanged for Korean won(legal tender) in one-to-one ratio.", "7. ‘KRW Market’ refers to market for trading cryptocurrencies using KRW as the key currency.", "8. ‘Pair Market’ refers to market for trading cryptocurrencies using cryptocurrencies such as Bitcoin and Ethereum as the key currency", "9. ‘External Virtual asset Address’ refers to all virtual asset addresses or accounts owned or used by the member or others outside of the service. External virtual asset address is not owned, controlled or managed by the Company.", "10. ‘Digital Wallet’ refers to virtual asset wallets owned by the member in order to store KRW and cryptocurrencies, linked to the member ID. The member can exchange cryptocurrencies with ‘External Virtual asset Address’ through this ‘Digital Wallet’.", "11. ‘Assets’ refers to both cryptocurrencies and KRW.", "12. ‘Transfer of Assets’ refers to the process of the member moving one’s asset from the Huobi Pro digital wallet or digital wallet of the Pair Market within the Huobi Korea service to the digital wallet of the Huobi Korea KRW market."]
